Diamond is a full time Mom and aspiring actress. Despite never fully pursuing her passion, she has always believed she could be a leading lady in Hollywood if only her shyness hadn't prevented her from doing so. One day in acting class, she decides to overcome this shyness by stepping outside of her comfort zone. And once she does, her glamorous set of bountiful bazookas leap into action with her.
